import React, { Component } from 'react';

class FreeBoard extends Component{
    render(){
        return(
	<table class ="table table-hover">
		<thead>
		<tr>
			<th>번호</th>
			<th>제목</th>
			<th>작성자</th>
			<th>날짜</th>
			<th>조회수</th>
		</tr>
		</thead>
		<tbody>
		<tr>
			<td>165</td>
			<td>이제 곧 4</td>
			<td>길라임</td>
			<td>2016.12.02</td>
			<td>2</td>
		</tr>
		</tbody>
	</table>
        );
    }
}

export default FreeBoard;
